type SpringCMServiceSoap struct {
	client *gowsdl.SoapClient
}

func NewSpringCMServiceSoap(url string, tls bool, cl *http.Client) *SpringCMServiceSoap {
	if url == "" {
		url = "https://soapna11.springcm.com/atlas/webservices/v201308/springcmservice.asmx"
	}
	client := gowsdl.NewSoapClient(url, tls, cl)

	return &SpringCMServiceSoap{
		client: client,
	}
}

/* Copy a folder or a document to another new location. Returns a map of the new document ids to the old document ids, and their respective folder ids. */
func (service *SpringCMServiceSoap) Copy(request *Copy) (*CopyResponse, error) {
	response := &CopyResponse{}
	err := service.client.Call("http://www.springcm.com/atlas/webservices/v201308/scm/Copy", request, response)
	if err != nil {
		return nil, err
	}

	return response, nil
}

/* Delete a document or folder from the repository */
func (service *SpringCMServiceSoap) Delete(request *Delete) (*DeleteResponse, error) {
	response := &DeleteResponse{}
	err := service.client.Call("http://www.springcm.com/atlas/webservices/v201308/scm/Delete", request, response)
	if err != nil {
		return nil, err
	}

	return response, nil
}

/* Move multiple folders or documents to a new destination folder. Will return any errors. */
